import React from 'react';
import { Card, CardContent, Typography, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Box } from '@mui/material';

// Helper to get recent transactions from real data
function getRecentTransactions(data) {
  // Example: try to extract from bank transactions or use mock
  const txns = data.fetch_bank_transactions?.transactions || [
    { date: 'May 15, 2023', description: 'Amazon.in Payment', category: 'Shopping', account: 'HDFC Credit Card', amount: -4599 },
    { date: 'May 12, 2023', description: 'Salary Credit', category: 'Income', account: 'ICICI Savings', amount: 125000 },
    { date: 'May 10, 2023', description: 'SIP Investment', category: 'Investment', account: 'HDFC Bank', amount: -25000 },
    { date: 'May 8, 2023', description: 'Zomato Order', category: 'Dining', account: 'HDFC Credit Card', amount: -850 },
    { date: 'May 5, 2023', description: 'Dividend Credit', category: 'Investment', account: 'Kotak Securities', amount: 3250 },
  ];
  return txns;
}

export default function RecentTransactions({ data }) {
  const txns = getRecentTransactions(data);
  return (
    <Card sx={{ borderRadius: 3, mt: 4 }}>
      <CardContent>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
          <Typography variant="h6" fontWeight={700}>Recent Transactions</Typography>
          <Typography variant="body2" color="primary" sx={{ cursor: 'pointer' }}>View all transactions â†’</Typography>
        </Box>
        <TableContainer component={Paper} sx={{ boxShadow: 0 }}>
          <Table size="small">
            <TableHead>
              <TableRow>
                <TableCell>DATE</TableCell>
                <TableCell>DESCRIPTION</TableCell>
                <TableCell>CATEGORY</TableCell>
                <TableCell>ACCOUNT</TableCell>
                <TableCell align="right">AMOUNT</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {txns.map((row, idx) => (
                <TableRow key={idx}>
                  <TableCell>{row.date}</TableCell>
                  <TableCell>{row.description}</TableCell>
                  <TableCell>{row.category}</TableCell>
                  <TableCell>{row.account}</TableCell>
                  <TableCell align="right" style={{ color: row.amount < 0 ? 'red' : 'green', fontWeight: 700 }}>
                    {row.amount < 0 ? '-' : '+'}â‚¹{Math.abs(row.amount).toLocaleString()}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </CardContent>
    </Card>
  );
}
